import React from 'react';

const Contact = () => {
  return (
    <section id="contact" className="py-16 px-6 bg-white">
      <h2 className="text-3xl font-semibold text-center mb-8">Contact Us</h2>
      <form className="max-w-xl mx-auto grid gap-4">
        <input type="text" placeholder="Your Name" className="p-3 border rounded" />
        <input type="email" placeholder="Your Email" className="p-3 border rounded" />
        <textarea placeholder="Message" className="p-3 border rounded h-32" />
        <button type="submit" className="bg-blue-600 text-white py-3 rounded">Send Message</button>
      </form>
    </section>
  );
};

export default Contact;
